import React, { Component } from "react";
import { connect } from "react-redux";
import Navbar from "react-bootstrap/Navbar";
import {
  Row,
  Col,
  Nav,
  Button,
  Container,
  Tabs,
  Tab,
  Form
} from "react-bootstrap";
import "../../css/grubhub.css";

class SignIn extends Component {
  constructor(props) {
    super(props);
    this.state = {
      activeTab: props.activeTab || 1
    };
  }

  handleSelect = selectedTab => {
    this.setState({
      activeTab: selectedTab
    });
  };
  render() {
    return (
      <div>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand href="/">GrubHub</Navbar.Brand>
        </Navbar>
        <Container>
          <div className="login u-dimension-1">
            <Tabs activeKey={this.state.activeTab} onSelect={this.handleSelect}>
              <Tab eventKey={1} title="Sign In as Customer">
                <h3 className="pt-5">Sign In with your GrubHub Account</h3>
                <Form>
                  <Form.Group>
                    <Form.Label>Email</Form.Label>
                    <Form.Control name="Email"></Form.Control>
                  </Form.Group>
                </Form>
              </Tab>
              <Tab eventKey={2} title="Sign In as Owner"></Tab>
            </Tabs>
          </div>
        </Container>
      </div>
    );
  }
}
function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(SignIn);
